	set pRezId=-1;
    if(pPocetak >= pKraj) then
    begin
		set pRezId=-2;
	end;
    else
		begin
			select count(*) from dogadjaj 
			where (((DOGADJAJ_TIP_Id=pDogadjajTipId) and ((pPocetak>Pocetak and pPocetak<Kraj) or (pKraj>Pocetak and pKraj<Kraj))) and (Aktivan=true))
