					insert into DOGADJAJ values(null, pOpis, pDogadjajTipId, pKorisnickiNalogId, pPocetak, pKraj, true);
                    select max(Id) from DOGADJAJ into pRezId;
				end;
            end if;
		end;
	end if;
end ;;
